// src/pages/Main.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Main.css'; // Ensure this CSS file exists and is correctly named

const Main = () => {
  return (
    <div className="button-container">
      <Link className="btn">Inventory Manager</Link>
      <Link className="btn">Invoice Generator</Link>
      <Link className="btn">Expense Tracker</Link>
      <Link className="btn">Payment Gateway</Link>
    </div>
  );
};

export default Main;
